"metaData":{
"desc":"Global REXYGEN HMI configuration component. User can change project options, configure the HTML export and define list of connections between REXYGEN target and HMI.",
"header_mode":{
"desc":"Change the default size of the header (thin, packed). If packed click on the logo to show the header.",
"order":"05",
"type":"enum",
"values":[
"",
"thin",
"pack-top-left",
"pack-top-right",
"pack-bottom-left",
"pack-bottom-right"
]
},
"kiosk_mode":{
"desc":"If True the links from header (from logo and header) are removed and user can not change the refresh rate and target.",
"order":"06",
"type":"bool"
},
"log_level":{
"desc":"Set the global log level for whole RexHMI. The log messages are written both to the right upper corner menu and to the web browser console. Default level is INFO.",
"order":"02",
"type":"enum",
"values":[
"",
"TRACE",
"DEBUG",
"INFO",
"WARN",
"ERROR"
]
},
"refresh_rate":{
"desc":"Changes the default read refresh rate of the whole HMI. Default 500ms",
"max":"300000",
"min":"20",
"order":"01",
"type":"int"
},
"show_clock":{
"desc":"If True the clock are shown in the right upper corner of the template instead of blinking square. If the target is connected the clock are updated if connection get error o lost the time stops.",
"order":"03",
"type":"bool"
},
"target_url":{
"desc":"The URL of the target device. So far only the WebSocket protocol is supported. The URL must also contain the PORT, but the protocol can be omitted. Default is empty string which means ws://127.0.0.1:8008 <br /> Examples: 192.168.1.100:8008 or wss://192.168.1.100:8009 <br /> <i> Note: If the HMI is hosted on the internal web server this option is ignored and HMI connects to the hostname / IP you use in the webbrowser URL.</i>",
"order":"07",
"prev":[
"ws_ip"
],
"type":"str"
},
"use_client_time":{
"desc":"If True the <code>show_clock</code> display the time from client computer rather then target. This can be use when target device does not have NTP synchronization or RTC chip.",
"order":"04",
"type":"bool"
}
},
"options":{
"header_mode":"",
"kiosk_mode":"False",
"log_level":"",
"refresh_rate":"",
"show_clock":"False",
"target_url":"",
"use_client_time":"False"
}
}

{
"connections":{
"disable_by":"",
"hide_by":"",
"refresh_from":""
},
"metaData":{
"connections":{
"disable_by":{
"default":"",
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"default":"",
"desc":"If non-zero the component is hidden.",
"optional":true
},
"refresh_from":{
"default":"$T",
"desc":"When the value is changed the image is updated.",
"optional":true
}
},
"desc":"Image Changer component loads image (*.png,*.jpg,*.bmp,*.svg etc.) and displays it inside its boundaries. The image is refreshed when the <code>refresh_from</code> datapoint changes or after given <code>period</code>. The <code>imagePath</code> should be relative to the root of the webserver. If the <code>appendKey</code> property is True and the <code>imagePath</code> contains <code>{0}</code> sign, the sign is replaced using the read value.<br /> Example of the <code>imagePath</code> <code>/hmi/images/img-{0}.png</code> and value can change from 0 to 10, etc.",
"html":true,
"options":{
"appendKey":{
"default":"False",
"desc":"If True the <code>{0}</code> is replaces with current <code>refresh_from</code> value in the <code>imagePath</code> property.",
"order":"02",
"type":"bool"
},
"imagePath":{
"default":"",
"desc":"Relative path from the webserver root where the image is located.",
"order":"01",
"type":"str"
},
"period":{
"default":"-1",
"desc":"If larger than zero the image will be automatically refreshed based on the given <code>period</code> in milliseconds. The <code>refresh_from</code> datapoint is used only for <code>appendKey</code> mode.",
"order":"03",
"type":"number"
}
},
"path":"GENERAL/ImageChanger.svg",
"updateType":"Partial"
},
"options":{
"appendKey":"False",
"imagePath":"/opencv/preview.png",
"period":1000
}
}

