"metaData":{
"connections":{
"disable_by":{
"default":"",
"desc":"If non-zero the component is disabled.",
"optional":true,
"order":"03"
},
"hide_by":{
"default":"",
"desc":"If non-zero the component is hidden.",
"optional":true,
"order":"04"
},
"readonly_by":{
"default":"",
"desc":"If non-zero the component will change once to read-only mode.",
"optional":true,
"order":"05"
},
"refresh_from":{
"default":"",
"desc":"If set the state of the component is updated based on the value read from this datapoint. Otherwise the value from main datapoint is used.",
"optional":true,
"order":"02",
"prev":[
"BUTTON_R"
]
},
"value":{
"default":"$T",
"desc":"The main datapoint where boolean value is written.",
"order":"01",
"prev":[
"BUTTON"
],
"write":true
}
},
"desc":"The Button component changes the boolean value. Normally the ON state means TRUE value and OFF mean FALSE value. If needed the parameter <code>reverseMeaning</code> switches the written values.<br /> There are three different modes of operation: <br /><code>PushButton</code> when press or touched the ON state is written to the target <code>value</code> datapoint. When released the OFF state is written.<br /><code>ManualPulse</code> always write TRUE value after button is pressed, release is ignored.(Suitable for MP block control)<br /><code>ToggleButton</code> when button is pressed the value is toggled (ON -> OFF -> ON).",
"html":true,
"options":{
"colorFalse":{
"default":"#FFFFFF",
"desc":"Button background color when the state is OFF",
"order":"06",
"type":"color"
},
"colorTrue":{
"default":"#00C8B4",
"desc":"Button background color when the state is ON",
"order":"07",
"type":"color"
},
"fontScale":{
"default":"1",
"desc":"Use this parameter to scale font because the button is using HTML button component which is not binded with SVG. ",
"order":"03",
"type":"float"
},
"labelColorFalse":{
"default":"#000000",
"desc":"Label (text) color when the state is OFF.",
"order":"08",
"type":"color"
},
"labelColorTrue":{
"default":"#FFFFFF",
"desc":"Label (text) color when the state is ON",
"order":"09",
"type":"color"
},
"labelFalse":{
"default":"ButtonText",
"desc":"Button label when the state is OFF",
"order":"04",
"prev":[
"text"
],
"type":"str"
},
"labelTrue":{
"default":"",
"desc":"Button label when the state is ON. If not defined the <code>labelFalse</code> is used.",
"order":"05",
"type":"str"
},
"reverseMeaning":{
"default":"False",
"desc":"If True the meaning of the value is switched. So the ON state is False and OFF state is True.",
"order":"02",
"type":"bool"
},
"type":{
"default":"PushButton",
"desc":"Changes the type of the Button.<br /><code>PushButton</code> when press or touched the ON state is written to the target <code>value</code> datapoint. When released the OFF state is written.<br /><code>ManualPulse</code> writes TRUE value once after button is pressed, release is ignored.<br /><code>ManualPulseRpt</code> writes TRUE value periodically (20ms period) after button is pressed, release stops writing.(Suitable for MP block control)<br /><code>ToggleButton</code> when button is pressed the value is toggled (ON -> OFF -> ON).",
"order":"01",
"type":"enum",
"values":[
"PushButton",
"ManualPulse",
"ManualPulseRpt",
"ToggleButton"
]
},
"writePerm":{
"columns":{
"login":{
"type":"str"
}
},
"default":[],
"desc":"List of logins who are allowed to write to the data point. If not in list the Button will be disabled.",
"order":"10",
"type":"table"
}
},
"path":"GENERAL/Button.svg",
"updateType":"Partial"
},
"options":{
"colorFalse":"#FFFFFF",
"colorTrue":"#00C8B4",
"fontScale":1,
"labelColorFalse":"#000000",
"labelColorTrue":"#FFFFFF",
"labelFalse":"ENABLE",
"labelTrue":"",
"reverseMeaning":"False",
"type":"ToggleButton",
"writePerm":[]
}
}

