},
"desc":"State indicator with text label. Define states with colors and labels using <code>values</code> table. Omit color string if not used (e.g. stroke color)",
"options":{
"values":{
"columns":{
"color":{
"desc":"Label color",
"order":"05",
"type":"color"
},
"fill":{
"desc":"Rectangle fill color",
"order":"03",
"type":"color"
},
"label":{
"desc":"Label leave empty if should not change.",
"order":"02",
"type":"string"
},
"stroke":{
"desc":"Rectangle stroke color",
"order":"04",
"type":"color"
},
"value":{
"desc":"If value is equal the component will have following look.",
"order":"01",
"type":"float"
}
},
"default":[
{
"color":"",
"fill":"#E74E3E",
"label":"NG",
"stroke":"",
"value":"0"
},
{
"color":"",
"fill":"#46B281",
"label":"OK",
"stroke":"",
"value":"1"
}
],
"desc":"List of labels and colors which will be shown when <code>value</code> changes. The priority is in asscending order. If any item in the <code>values</code> table is empty string, the look will not be changed.",
"order":"01",
"type":"table"
}
},
