"desc":"Display component shows value from the target system as a string. It can be either <code>number</code>, <code>date</code>, <code>datetime</code> or simple value as a <code>text</code> string depending on the <code>format</code> property. Each display can have <code>units</code> which are shown at the end of the displayed string.",
"options":{
"color":{
"default":"#000000",
"desc":"Normal font color of the display. Applicable for <code>number</code> format only.",
"order":"06",
"type":"color"
},
"colorAbove":{
"default":"#ff0000",
"desc":"Font color of the display when the read value is above <code>rangeMax</code>. Applicable for <code>number</code> format only.",
"order":"07",
"type":"color"
},
"colorBelow":{
"default":"#0000ff",
"desc":"Font color of the display when the read value is below <code>rangeMin</code>. Applicable for <code>number</code> format only.",
"order":"08",
"type":"color"
},
"decimals":{
"default":"2",
"desc":"Round the read value to defined number of decimals. Applicable for <code>number</code> format only.",
"max":"6",
"min":"0",
"order":"05",
"type":"int"
},
"format":{
"default":"number",
"desc":"<code>number</code> - If selected the read value is converted to the number either integer or float. Also the parameters <code>scale</code>,<code>offset</code> and <code>decimals</code> are applied during conversion. The color of the text depends on the <code>color</code> property if the value is higher than <code>rangeMax</code> the <code>colorAbove</code> is used likewise if the value is lower than  <code>rangeMin</code> the <code>colorBelow</code> is applied.<br /><code>time</code> and <code>datetime</code> - The display will convert read value in milliseconds from REXYGEN Epoch to the current time or datetime. The property <code>text_format</code> is applied in this context where the format of the displayed time can be selected.<br /><code>text</code> - Simple show the value in the format as was received. Suitable for short strings.",
"order":"01",
"type":"enum",
"values":[
"number",
"time",
"datetime",
"text"
]
},
"offset":{
"default":"0",
"desc":"Add some offset to the read value. Applicable for <code>number</code> format only.",
"order":"04",
"type":"float"
},
"rangeMax":{
"default":"10",
"desc":"When the read value is above <code>rangeMax</code> the <code>colorAbove</code> color is applied to the font. Applicable for <code>number</code> format only.",
